import React from 'react'
import { RedocStandalone } from 'redoc';


const About = () => (
  <div>
    <RedocStandalone specUrl="http://1forge.com/openapi.json"/>
    <h1>About Page</h1>
    <p>Did you get here via Redux?</p>
  </div>
)

export default About
